tColor2\":\"000729\",\"bgColor\":\"f1f1f1\",\"textColor1\":\"000000\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Features126\\/v4\\/b7\\/14\\/60\\/b71460a4-a852-2b92-d5bd-063bb2523834\\/30c72f6c-5228-4ec9-8dc9-fd28d91efbf8.png\\/{w}x{h}cc.jpg\",\"width\":4320,\"height\":1080},\"supportsSing\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/playlist\\/top-100-barbados\\/pl.13743dcd86174ea5b4cb6b2534637e23\",\"curatorName\":\"Apple Music\",\"description\":{\"standard\":\"The most-played songs in Barbados, updated every day.\"},\"lastModifiedDate\":\"2025-01-11\"},\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"isLibrary\":false,\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"kind\":\"globalPlaylistID\",\"value\":\"pl.13743dcd86174ea5b4cb6b2534637e23\"},\"id\":\"pl.13743dcd86174ea5b4cb6b2534637e23\",\"type\":\"Playlist\"}}}],\"chart\":\"daily-global-top\",\"next\":\"\\/v1\\/catalog\\/ca\\/charts?chartId=119&genre=51&offset=20\",\"href\":\"\\/v1\\/catalog\\/ca\\/charts?chartId=119&genre=51\",\"orderId\":\"daily-global-top:dailyGlobalTopCharts\"}],\"music-videos\":[],\"albums\":[{\"chart\":\"most-played\",\"next\":\"\\/v1\\/catalog\\/ca\\/charts?chart=most-played&genre=51&offset=20&types=albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/charts?chart=most-played&genre=51&types=albums\",\"data\":[{\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"id\":\"1780411692\",\"type\":\"Album\",\"isLibrary\":false,\"catalogID\":{\"value\":\"1780411692\",\"kind\":\"adamID\"},\"preferredIdentifierKind\":\"catalogID\"}},\"type\":\"albums\",\"id\":\"1780411692\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1780411692\",\"attributes\":{\"editorialNotes\":{\"standard\":\"Mixtape <i>HOP<\\/i>—not to be confused with Stray Kids’ 2018 EP titled <i>Mixtape<\\/i>—is the K-pop group’s final release in a busy 2024. As in hip-hop, K-pop artists use the term “mixtape” to categorize material released without the level of promotional fanfare of a regular album or single; K-pop mixtapes are usually self-produced and may feature tracks that fall outside of a group’s existing discographic boundaries in some way, e.g., a focus on solo music. \\n\\nStray Kids subunit 3RACHA (aka Bang Chan, Changbin, and Han) has co-written most of the group’s songs since their 2018 debut. <i>HOP<\\/i>, however, expands the self-production responsibilities, with each member getting co-writing credit on their own solo songs, originally performed as part of the group’s “dominATE” world tour set list. In addition to the solo tracks, <i>HOP<\\/i> includes two versions of lead single “Walkin on Water,” an old-school hip-hop track. B-side “U” features Epik High leader Tablo, a K-pop sunbaenim influential in the Korean hip-hop scene.\\n\",\"tagline\":\"New Mixtape\",\"short\":\"The K-pop group takes solo turns on self-produced tracks.\"},\"copyright\":\"℗ 2024 JYP Entertainment\",\"audioVariants\":[],\"trackCount\":12,\"isComplete\":true,\"artistName\":\"Stray Kids\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/hop\\/1780411692\",\"playParams\":{\"kind\":\"album\",\"catalogId\":\"1780411692\",\"id\":\"1780411692\"},\"recordLabel\":\"Republic Records - Stray Kids\",\"name\":\"HOP\",\"artwork\":{\"textColor3\":\"ccc0a5\",\"textColor1\":\"f8eccb\",\"textColor2\":\"ebe6c5\",\"height\":1400,\"textColor4\":\"c2bba0\",\"width\":1400,\"bgColor\":\"1c110b\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/b3\\/e2\\/83\\/b3e28373-7aad-03c0-b8ec-9b1d9e706989\\/8809928953014_Cover.jpg\\/{w}x{h}bb.jpg\"},\"contentRating\":\"clean\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"isCompilation\":false,\"upc\":\"8809928953014\",\"releaseDate\":\"2024-12-13\",\"isSingle\":false,\"isAppleDigitalMaster\":false}},{\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1709554767\",\"id\":\"1709554767\",\"attributes\":{\"isSingle\":false,\"name\":\"GOLDEN\",\"copyright\":\"℗ 2023 BIGHIT MUSIC\",\"artwork\":{\"width\":1400,\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music126\\/v4\\/86\\/78\\/b4\\/8678b4b3-2341-7239-b6cb-bcfdaef0e4e0\\/196922656545_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor3\":\"c9ab4f\",\"textColor2\":\"f3b241\",\"textColor4\":\"c39b3b\",\"height\":1400,\"textColor1\":\"fac659\",\"bgColor\":\"044023\"},\"audioVariants\":[],\"artistName\":\"Jung Kook\",\"releaseDate\":\"2023-11-03\",\"contentRating\":\"explicit\",\"isCompilation\":false,\"isComplete\":true,\"editorialNotes\":{\"tagline\":\"New Album\",\"short\":\"The BTS star matures on his solo debut: “I’ve gained more confidence.”\",\"standard\":\"When BTS began a group hiatus in 2022, Jung Kook used the opportunity to collaborate with a variety of artists and producers for his solo album debut. “My work as part of BTS was very important,” the Korean singer told Apple Music’s Zane Lowe. “I think this time in my life is equally if not even more important.” The result is an 11-track English-language LP that is not only perfectly primed for a mainstream global listening audience, but also embraces an exploration of more explicitly sexy subject matter for the Korean superstar. “None of the songs actually are my personal stories,” said Jung Kook. “They\'re all love songs, which I felt were the most universal feeling. So I wanted to work on a lot of these good songs that fit within that kind of theme.”\\n\\nPre-release tracks “Seven” (featuring Latto) and “3D” (featuring Jack Harlow) immediately set the tone for <i>GOLDEN<\\/i>’s role in showcasing a more adult side of Jung Kook. “As a young artist this would be the time for me to sing lyrics like that, and I needed to change up my image a little,” said Jung Kook. “3D” was written (alongside BloodPop® and Harlow) by “Dynamite” co-writer David Stewart, who also contributes to <i>GOLDEN<\\/i> with breakup tracks “Too Sad to Dance” (“And this Christmas, I got no gifts\\/Do I really deserve all this?”) and “Shot Glass of Tears” (“She got some dangerous hobbies\\/Like chasing after the sun and making me fall in love”). \\n\\nJung Kook’s exploration of the power of attraction continues across the album, including in the groovy, disco-inflected “Standing Next to You” (“You know that all night long, we rock to this\\/Screaming, I testify this lovin\'”) and the hypnotic Major Lazer team-up “Closer to You” (“Take you like my last breath\\/Took me, that\'s the first step”). The former is Jung Kook’s favourite. “Of course, the song itself is great, but more than that, it just allowed me to see this grandiose picture when I heard the song and I could see myself right away performing onstage with that song.”\\n\\nElsewhere on <i>GOLDEN<\\/i>, Jung Kook explores other relationship themes. Ed Sheeran has a co-writing credit on the playful, boy-band-esque bop “Yes or No” about maybe falling in love (“Are you feeling the rush?\\/If so, then I think I know what\'s going on”), while Shawn Mendes was behind the scenes for “Hate You,” a confessional broken-heart ballad (“I’m gonna hate you\\/Paint you like the villain that you never were\\/I\'m gonna blame you\\/For things that you don\'t do”). On “Somebody,” Jung Kook tells the story of a person who is ready to move on from a relationship (“Oh, I hoped you\'d find somebody\\/I hope you know that somebody ain\'t me”), while “Please Don’t Change” is a plea from one star-crossed lover to another that they stay the same until they can find a way to be together (“Please don’t change\\/’Cause I love you, yeah, I love you”).\\n\\nThe album’s title is a reference to JK’s nickname as the “golden <i>maknae<\\/i>” of BTS. “Maknae” (or 막내, in Korean) refers to the youngest member of a family or group, while “golden” refers to JK’s innate talent in a variety of skills. “When I first started [as an artist], I was very quiet. I didn\'t have self-confidence,” Jung Kook told Apple Music. “But as I started working on my music, I learned more about myself. I earned that description ‘golden.’ Looking at all of these achievements, I’ve gained more confidence. So it\'s a combination of all of those things that was poured into the album.”\\n\"},\"playParams\":{\"catalogId\":\"1709554767\",\"id\":\"1709554767\",\"kind\":\"album\"},\"isAppleDigitalMaster\":false,\"recordLabel\":\"BIGHIT MUSIC\",\"upc\":\"196922656545\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/golden\\/1709554767\",\"trackCount\":11,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"]},\"meta\":{\"musicKit_identifierSet\":{\"catalogID\":{\"value\":\"1709554767\",\"kind\":\"adamID\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"isLibrary\":false,\"preferredIdentifierKind\":\"catalogID\",\"id\":\"1709554767\",\"type\":\"Album\"}}},{\"id\":\"1774299753\",\"type\":\"albums\",\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"type\":\"Album\",\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"value\":\"1774299753\",\"kind\":\"adamID\"},\"isLibrary\":false,\"id\":\"1774299753\"}},\"attributes\":{\"artistName\":\"TWICE\",\"isComplete\":true,\"copyright\":\"℗ 2024 JYP Entertainment Corporation\",\"releaseDate\":\"2024-12-06\",\"editorialNotes\":{\"tagline\":\"New Mini Album\",\"short\":\"Megan Thee Stallion guests on the veteran K-pop group’s 14th mini album.\",\"standard\":\"Ten months after the release of chart-topping mini album <i>With YOU-th<\\/i>, K-pop group TWICE released <i>STRATEGY<\\/i>. The 14th mini album in their near decade-long career leads with the English-language “Strategy,” a smooth song outlining the pop powerhouses’ ultra-confident seduction plan: “I got you on my radar, soon you\'re gonna be with me\\/My strategy, strategy will getcha, getcha, baby.” Megan Thee Stallion, who is becoming increasingly prolific as a K-pop collaborator, features on the main version of the title track, lending her precise flow to TWICE’s buoyant pop: “I\'m a man-eater, you just a light snack\\/I got him pressed like he\'s workin\' on his triceps.” The K-pop collaboration is a follow-up to TWICE’s feature on the Houston rapper’s “Mamushi” remix, also released in 2024. \\n\\nElsewhere on the seven-track album, TWICE gives their fans, known as ONCE, a holiday gift with the seasonally minded love song “Magical”: “I always hated the winter season\\/My heart was right on the brink of freezing\\/Then you came around and suddenly\\/It\'s like I\'m never gonna be cold again.” Notably, TWICE member Dahyun co-wrote the lyrics for “Keeper,” one of three tracks (in addition to “Like It Like It” and “Sweetest Obsession”) that feature Korean-language lyrics. \\n\"},\"isAppleDigitalMaster\":false,\"name\":\"STRATEGY\",\"contentRating\":\"clean\",\"isCompilation\":false,\"isSingle\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"audioVariants\":[],\"artwork\":{\"textColor3\":\"d1cfd2\",\"bgColor\":\"19121f\",\"textColor4\":\"c0b5b5\",\"height\":1400,\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music221\\/v4\\/d3\\/65\\/0c\\/d3650c39-d01d-2453-6826-9aa21ad22559\\/8809928952925_Cover.jpg\\/{w}x{h}bb.jpg\",\"width\":1400,\"textColor2\":\"eadddb\",\"textColor1\":\"ffffff\"},\"playParams\":{\"catalogId\":\"1774299753\",\"kind\":\"album\",\"id\":\"1774299753\"},\"recordLabel\":\"Republic Records - TWICE\",\"trackCount\":7,\"upc\":\"8809928952925\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/strategy\\/1774299753\"},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1774299753\"},{\"meta\":{\"musicKit_identifierSet\":{\"type\":\"Album\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"id\":\"1763658157\",\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1763658157\"},\"isLibrary\":false}},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1763658157\",\"attributes\":{\"artwork\":{\"textColor3\":\"65c6cc\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/1f\\/47\\/3a\\/1f473a01-7d87-23f5-ee05-3a450cd5537a\\/198704101359_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor2\":\"8dbffd\",\"textColor1\":\"7cf5fb\",\"textColor4\":\"729bce\",\"height\":1400,\"width\":1400,\"bgColor\":\"0a0a12\"},\"name\":\"CRAZY - EP\",\"artistName\":\"LE SSERAFIM\",\"upc\":\"198704101359\",\"isAppleDigitalMaster\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"contentRating\":\"clean\",\"releaseDate\":\"2024-08-30\",\"isComplete\":true,\"isSingle\":false,\"playParams\":{\"catalogId\":\"1763658157\",\"id\":\"1763658157\",\"kind\":\"album\"},\"editorialNotes\":{\"short\":\"The K-pop group talks through each of the tracks on their fourth mini album.\",\"standard\":\"“During production, as we concentrated more and more on the songs, it occurred to me that ‘CRAZY’ is a word that perfectly suits the music,” K-pop idol KAZUHA tells Apple Music about the lead single from LE SSERAFIM’s fourth mini album, also titled <i>CRAZY<\\/i>. Phonky and upbeat, the song is a part of an eclectic five-track album from the Korean girl group, who debuted in 2022. In an effort to explore the various meanings of the title word, <i>CRAZY<\\/i> moves from the EDM-fuelled spoken-word track “Chasing Lightning” to the hip-hop hype song “Pierrot” (sampling Kim Wan Sun’s 1990 hit “Pierrot Laughs at Us”) to the Coachella-debuted dance-pop number “1-800-hot-n-fun.” It all culminates in the tender ballad “Crazier,” titled something closer to “the reason I can’t go crazy” in its original Korean. “Having this as the last track on the album is like us posing a question to you,” shares YUNJIN. “What does CRAZY mean to you?” Here’s what the five members of LE SSERAFIM—SAKURA, KIM CHAEWON, HUH YUNJIN, KAZUHA, and HONG EUNCHAE—had to say about each track.\\n\\n<b>“Chasing Lightning”<\\/b> \\nSAKURA: “This is the five of us sharing thoughts about things we’re into, stuff that we’re crazy about. And it has a message: ‘Listen to your own heart and change this moment!’ Unlike the intro tracks from our previous albums, we switched things up here by opening with everyday conversation.”\\n\\n<b>“CRAZY”<\\/b> \\nKAZUHA: “‘CRAZY’ is the title track of the album. It’s about moments when you discover something that you can go crazy about. When I first saw the title I was like, ‘Wow, that’s pretty intense!’ [laughs] During production, as we concentrated more and more on the songs, it occurred to me that ‘CRAZY’ is a word that perfectly suits the music. The melody on this track has a great hook that gets you humming along to it, anytime and anywhere. It’s perfect for when you need a burst of excitement or a boost in self-esteem.”\\n\\n<b>“Pierrot”<\\/b>\\nKIM CHAEWON: “The sample here is from ‘Pierrot Laughs at Us’ by Kim Wan Sun. Personally, I’m a fan of the hip-hop style. I was really glad to do ‘Pierrot’ because it\'s in my favoured style and also showcases a fresh new side to us as a group.”\\n\\n<b>“1-800-hot-n-fun”<\\/b>\\nHONG EUNCHAE: “I like how the title is in the form of an American toll-free number. The track is all about the message: ‘Call us at “1-800-hot-n-fun”! Let’s have a hot and wild time together!’ It’s filled with fun little details, too. My favourite lyric from this is ‘Where the heck is SAKI?’—‘SAKI’ being our nickname for SAKURA. The track is brimming with a rock feel, so please enjoy.”\\n\\n<b>“Crazier”<\\/b>\\nHUH YUNJIN: “I think the word ‘crazy’ means different things to different people. The members before me talked about four songs that each have their own take on ‘crazy.’ But this last track, ‘Crazier,’ is different. It’s about the absence of ‘crazy.’ The message of the song is that youthful life can be beautiful, even if lacking in crazy, which we wanted to convey with sincerity and empathy. Having this as the last track on the album is like us posing a question to you: ‘What does CRAZY mean to you?’”\",\"tagline\":\"New Mini Album\"},\"recordLabel\":\"SOURCE MUSIC\",\"audioVariants\":[],\"copyright\":\"℗ 2024 SOURCE MUSIC\",\"isCompilation\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/crazy-ep\\/1763658157\",\"trackCount\":5},\"id\":\"1763658157\",\"type\":\"albums\"},{\"type\":\"albums\",\"id\":\"1776917020\",\"meta\":{\"musicKit_identifierSet\":{\"isLibrary\":false,\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"type\":\"Album\",\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"value\":\"1776917020\",\"kind\":\"adamID\"},\"id\":\"1776917020\"}},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1776917020\",\"attributes\":{\"isSingle\":false,\"isCompilation\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/romance-untold-daydream\\/1776917020\",\"playParams\":{\"kind\":\"album\",\"id\":\"1776917020\",\"catalogId\":\"1776917020\"},\"audioVariants\":[],\"upc\":\"198704187797\",\"artwork\":{\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music221\\/v4\\/5f\\/c8\\/8c\\/5fc88cb7-faf5-483a-ea42-ebf112c5f3d7\\/198704187797_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor2\":\"161d22\",\"bgColor\":\"b5b7b3\",\"textColor3\":\"2b3338\",\"textColor4\":\"363c3f\",\"height\":1400,\"width\":1400,\"textColor1\":\"09121a\"},\"trackCount\":11,\"name\":\"ROMANCE : UNTOLD -daydream-\",\"copyright\":\"℗ 2024 BELIFT LAB\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"isComplete\":true,\"contentRating\":\"clean\",\"artistName\":\"ENHYPEN\",\"recordLabel\":\"BELIFT LAB\",\"isAppleDigitalMaster\":false,\"releaseDate\":\"2024-11-11\"}},{\"id\":\"1695951888\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1695951888\",\"attributes\":{\"artistName\":\"NewJeans\",\"isCompilation\":false,\"releaseDate\":\"2023-07-21\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/newjeans-2nd-ep-get-up\\/1695951888\",\"playParams\":{\"id\":\"1695951888\",\"kind\":\"album\",\"catalogId\":\"1695951888\"},\"recordLabel\":\"ADOR\",\"audioVariants\":[],\"copyright\":\"℗ 2023 ADOR Co., Ltd.\",\"isComplete\":true,\"editorialNotes\":{\"short\":\"Six tracks that reassert the group\'s effortless brand of teen-girl cool.\",\"standard\":\"In 2022, NewJeans dropped into the saturated K-pop industry with zero pre-promotion. The music video for “Attention” combined breezy R&B-inspired pop, immaculate Y2K-nostalgic visuals, and the teen-girl cool of Minji, Haerin, Hanni, Danielle, and Hyein. Now they’re back with their second EP, a mini-album featuring six short tracks that reasserts NewJeans’ dominance in the fourth-generation K-pop scene. \\n\\nSonically, <i>Get Up<\\/i> doubles down on NewJeans’ commitment to noughts-era R&B paired with electronic dance elements. Pre-release singles “Super Shy”—which member Hanni says reminds her of flying through space on a rocket ship—and <i>Powerpuff Girls<\\/i> collab “New Jeans” are peppy, synth-driven bops that fans of “Ditto” will love. But the girls have never been as solemn as they are on “Cool With You,” a UK garage track, and “Get Up,” two songs that could be teasing an evolution of their vibe. Tying the sophomore project together are the versatile, finely tuned vocals of the young members, which continue to elevate NewJeans’ music from forgettable pop to something more textured—and serve as a tribute to the teen-girl interiority that is at the centre of NewJeans’ music and story.\",\"tagline\":\"New EP\"},\"trackCount\":6,\"upc\":\"196922462726\",\"name\":\"NewJeans 2nd EP \'Get Up\'\",\"isSingle\":false,\"isAppleDigitalMaster\":false,\"contentRating\":\"clean\",\"artwork\":{\"textColor1\":\"000000\",\"bgColor\":\"8fc1e2\",\"height\":1400,\"textColor3\":\"1c272d\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music116\\/v4\\/d3\\/4b\\/7e\\/d34b7e1e-af3b-43b6-2949-7a8c652a1bc9\\/196922462726_Cover.jpg\\/{w}x{h}bb.jpg\",\"width\":1400,\"textColor2\":\"0c244b\",\"textColor4\":\"264369\"},\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"]},\"meta\":{\"musicKit_identifierSet\":{\"isLibrary\":false,\"type\":\"Album\",\"preferredIdentifierKind\":\"catalogID\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1695951888\"},\"id\":\"1695951888\"}},\"type\":\"albums\"},{\"type\":\"albums\",\"id\":\"1773262053\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1773262053\",\"attributes\":{\"name\":\"DRIP\",\"isSingle\":false,\"upc\":\"8809519880477\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"isComplete\":true,\"copyright\":\"℗ 2024 YG Entertainment\",\"isCompilation\":false,\"playParams\":{\"catalogId\":\"1773262053\",\"id\":\"1773262053\",\"kind\":\"album\"},\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/drip\\/1773262053\",\"editorialNotes\":{\"short\":\"The seven-member girl group seeks to follow in BLACKPINK’s footsteps.\",\"standard\":\"YG Entertainment launched BABYMONSTER in April 2024, hoping the seven-member girl group would follow in the footsteps of their ultra-successful company predecessors 2NE1 and BLACKPINK. <i>DRIP<\\/i>, BABYMONSTER’s inaugural full-length album, gives young members Ruka, Pharita, Asa, Ahyeon, Rami, Rora, and Chiquita a first proper chance to build towards those K-pop ambitions.\\n\\n“Tonight, the stars are shining bright,” they sing on the title track, a dramatic EDM dance number that fits right into YG’s rich tradition of “girl crush” swagger songs. “Baby got passion, ambition, and I flaunt it,” sings Thai member Pharita, before Korean singer Rami comes in with “Look at that every move I make, I feel it in my bones.” Co-written by BIGBANG’s G-DRAGON, the track sustains its bouncy energy as it builds to a sparkling, sustained high note from Ahyeon, before launching into the high-powered outro. On the English-language rap track “CLIK CLAK,” the girls are “spending money, charge, charge, charge,” just like their sunbaenim LISA. But in B-side “BILLIONAIRE,” they argue that there are qualities that money just can’t buy: “World is mine, yeah, life is so unfair\\/Money don\'t compare, I got something rare\\/Feeling like a billionaire.”\\n\\nBABYMONSTER slows things down, giving listeners a chance to appreciate the richness of their vocal tones, on the minimalist love song “Love, Maybe.” The theme continues on “Really Like You” and the thumping dance track “Love in My Heart,” co-written by Japanese members Ruka and Asa (“I won\'t hold back anymore\\/Give you all of the love in my heart”). Rappers Ruka and Asa get another chance to shine in the nursery-rhyme-like “Woke Up in Tokyo,” an official subunit song. The album wraps with the previously released summer single “FOREVER” and a remix of the group’s debut track “BATTER UP,” tying their young discography together and laying out their master plan: “Screams will turn into cheers, loud, surprisе\\/Yo, the rise of the monster\\/My way will be shining forever, way.”\\n\",\"tagline\":\"New Album\"},\"trackCount\":9,\"artwork\":{\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music221\\/v4\\/b9\\/e1\\/ef\\/b9e1ef3a-e3eb-8152-e91b-20aca0fc9ffd\\/BM_DRIP_Digital-Cover_4000.jpg\\/{w}x{h}bb.jpg\",\"height\":4000,\"width\":4000,\"textColor1\":\"38ff7d\",\"textColor2\":\"fa10b0\",\"textColor4\":\"d20da6\",\"textColor3\":\"37cb7d\",\"bgColor\":\"36007d\"},\"audioVariants\":[],\"releaseDate\":\"2024-11-01\",\"artistName\":\"BABYMONSTER\",\"isAppleDigitalMaster\":false,\"recordLabel\":\"YG Entertainment\",\"contentRating\":\"clean\"},\"meta\":{\"musicKit_identifierSet\":{\"preferredIdentifierKind\":\"catalogID\",\"type\":\"Album\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1773262053\"},\"isLibrary\":false,\"id\":\"1773262053\"}}},{\"meta\":{\"musicKit_identifierSet\":{\"type\":\"Album\",\"isLibrary\":false,\"id\":\"1752739357\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"value\":\"1752739357\",\"kind\":\"adamID\"}}},\"type\":\"albums\",\"attributes\":{\"isAppleDigitalMaster\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/ate\\/1752739357\",\"copyright\":\"℗ 2024 JYP Entertainment\",\"audioVariants\":[],\"editorialNotes\":{\"tagline\":\"New Mini Album\",\"standard\":\"In between world tours and festival-headlining performances, fourth-generation K-pop superstars Stray Kids released their ninth mini album. Titled <i>ATE<\\/i>, a reference to the TikTok-maximized slang that comes from “dominate” and refers to an action done with unqualified style, the eight-track effort takes the theme to heart. Lead single “Chk Chk Boom,” a thumping Latin-pop-inspired hip-hop track, goes characteristically K-pop-hard with its confidence: “I\'ma pop, pop, pop, take a shot, yeah\\/Shoot down my goals one by one, I snipe them.” The eight members are metaphoric giants in anthem “MOUNTAINS” (“Tower over crowds, don’t pause ’cause I’m lovin’ it”), but approach the central theme sonically softer in “Stray Kids,” a sentimental drum-and-bass number reflecting on the group’s ascension since their 2018 debut: “Know that this is who we are\\/There ain\'t no last step out, oh, we\'ll never stop.”\\n\\nStray Kids’ members—mostly Bang Chan, Changbin, and Han, aka producing subunit 3RACHA— have production credits on every track. Australian rapper Felix helped write the English-language “Runners,” which begins with his husky vocals declaring the group’s energy: “I\'m just getting started, yeah, I know\\/I’m on my way ’cause this is all about me, ’bout me.” As with most pop albums, there’s still room for love songs. The upbeat pop track “I Like It” explores the heady beginnings of love (“I think I’m addicted to the title ‘You & Me’\\/Don’t ask, ‘What are we?’\\/Ooh, ooh, I like it, baby”), while the moody Korean-language ballad “twilight” takes on the chilly aftermath (“It cooled down, did the temperature of you and me burn so hot that it turned to ashes?”).\\n\\nIt’s not all serious, though. Trap-pop track “JJAM” gets deliciously silly with its cross-cultural wordplay, making plenty of English-language jelly jokes (“We stick together day and night, yeah”) while also bringing in the Korean-language slang phrase “노잼,” pronounced similarly to “no jam” and meaning “no fun”: “I got no 잼\\/You got no 잼\\/We gotta jam.” At the top of their game as K-pop superstars, Stray Kids refuse to sacrifice their fun: “It’s our playground, it\'s getting crowded.”\",\"short\":\"A confident cross-cultural statement from one of K-pop’s biggest groups.\"},\"artistName\":\"Stray Kids\",\"isCompilation\":false,\"isSingle\":false,\"playParams\":{\"kind\":\"album\",\"id\":\"1752739357\",\"catalogId\":\"1752739357\"},\"recordLabel\":\"Republic Records - Stray Kids\",\"upc\":\"8809928952123\",\"isComplete\":true,\"contentRating\":\"clean\",\"artwork\":{\"width\":1400,\"height\":1400,\"bgColor\":\"020202\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/24\\/c1\\/47\\/24c147fc-cf70-0a4e-3e21-bd9a42617572\\/8809928952123_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor1\":\"f5f6f8\",\"textColor2\":\"dfdfdf\",\"textColor4\":\"b2b2b2\",\"textColor3\":\"c4c5c6\"},\"releaseDate\":\"2024-07-19\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"trackCount\":8,\"name\":\"ATE\"},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1752739357\",\"id\":\"1752739357\"},{\"meta\":{\"musicKit_identifierSet\":{\"id\":\"1313175579\",\"preferredIdentifierKind\":\"catalogID\",\"catalogID\":{\"value\":\"1313175579\",\"kind\":\"adamID\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"type\":\"Album\",\"isLibrary\":false}},\"attributes\":{\"isComplete\":true,\"playParams\":{\"catalogId\":\"1313175579\",\"kind\":\"album\",\"id\":\"1313175579\"},\"releaseDate\":\"2016-12-13\",\"artistName\":\"BIGBANG\",\"audioVariants\":[],\"copyright\":\"℗ 2016 YG Entertainment\",\"editorialNotes\":{\"short\":\"The final chapter of the group\'s 10th anniversary project, MADE.\",\"standard\":\"The final chapter of the group\'s 10th anniversary project, MADE.\",\"name\":\"MADE -KR EDITION-\"},\"trackCount\":11,\"isCompilation\":false,\"isAppleDigitalMaster\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"name\":\"MADE\",\"isSingle\":false,\"recordLabel\":\"YG Entertainment\",\"upc\":\"191222000524\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/made\\/1313175579\",\"artwork\":{\"textColor4\":\"a3a3a3\",\"bgColor\":\"161616\",\"height\":4000,\"width\":4000,\"textColor3\":\"c4c4c4\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music125\\/v4\\/5b\\/9b\\/8e\\/5b9b8ef2-998e-1210-8454-dfebfbf6271c\\/BB_COVER_IMAGE_4000.jpg\\/{w}x{h}bb.jpg\",\"textColor2\":\"c7c7c7\",\"textColor1\":\"f0f0f0\"},\"contentRating\":\"clean\"},\"id\":\"1313175579\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1313175579\",\"type\":\"albums\"},{\"attributes\":{\"isComplete\":true,\"editorialNotes\":{\"short\":\"The last of the BTS members to go solo drops six tracks designed for comfort.\",\"standard\":\"In November 2024, five months after his exit from mandatory military service, singer Kim Seok-jin, aka Jin, became the last of BTS’s seven members to release a solo project. <i>Happy<\\/i> is a six-track EP from BTS’s eldest, a tenor known for his smooth vocals and warm, sometimes goofy persona. As with many BTS tracks—both solo and group—the six songs on <i>Happy<\\/i> are designed as sources of comfort for world-weary listeners looking for a “Dynamite”-level kick-start to, or a “Spring Day”-like reassurance in, their daily routines. “I’ll Be There,” a rockabilly pop-rock track that has Jin promising listeners he will always sing for them, falls into the former category, while the sweet ballad “I will come to you” veers closer to the hopeful yearning of the latter (“When the warm spring breeze blows\\/I’ll go to you”).\\n\\nNotable collaborators on <i>Happy<\\/i> include Gary Barlow, the lead singer and primary songwriter of English rock band Take That. Barlow co-produced and co-wrote lead single “Running Wild,” a pop-rock track reminiscent of Jin’s 2022 Coldplay collab “The Astronaut.” Jin’s K-pop colleague WENDY, a vocalist for Red Velvet, lent her voice to the duet “Heart on the Window,” while Taka and Toru of Japanese rock band ONE OK ROCK co-wrote “Falling.” Big Hit Music producer and frequent BTS collaborator Pdogg worked on four of the six tracks, weaving Jin’s solo album debut even more tightly into the broader BTS musical journey.\\n\",\"tagline\":\"New EP\"},\"isCompilation\":false,\"releaseDate\":\"2024-11-15\",\"playParams\":{\"kind\":\"album\",\"id\":\"1772351320\",\"catalogId\":\"1772351320\"},\"name\":\"Happy - EP\",\"recordLabel\":\"BIGHIT MUSIC\",\"isAppleDigitalMaster\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"isSingle\":false,\"contentRating\":\"clean\",\"upc\":\"198704169175\",\"artistName\":\"Jin\",\"artwork\":{\"textColor2\":\"e1f1f5\",\"width\":1400,\"height\":1400,\"textColor3\":\"ccd8e4\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music221\\/v4\\/c5\\/21\\/a1\\/c521a133-2a4d-05da-205f-19093c53cd55\\/198704169175_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor4\":\"b8ceec\",\"textColor1\":\"f9feea\",\"bgColor\":\"163ecb\"},\"trackCount\":6,\"copyright\":\"℗ 2024 BIGHIT MUSIC\",\"audioVariants\":[],\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/happy-ep\\/1772351320\"},\"id\":\"1772351320\",\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1772351320\",\"meta\":{\"musicKit_identifierSet\":{\"preferredIdentifierKind\":\"catalogID\",\"isLibrary\":false,\"id\":\"1772351320\",\"type\":\"Album\",\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1772351320\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"]}}},{\"id\":\"1780411784\",\"type\":\"albums\",\"attributes\":{\"recordLabel\":\"Lloud Co.\\/RCA Records\",\"playParams\":{\"kind\":\"album\",\"id\":\"1780411784\",\"catalogId\":\"1780411784\"},\"isComplete\":false,\"name\":\"Alter Ego\",\"trackCount\":12,\"isCompilation\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/alter-ego\\/1780411784\",\"contentRating\":\"explicit\",\"genreNames\":[\"Pop\",\"Music\",\"K-Pop\"],\"isSingle\":false,\"isAppleDigitalMaster\":false,\"upc\":\"196872662429\",\"copyright\":\"℗ 2024 RCA Records, under exclusive license from Lloud Co.\",\"artwork\":{\"height\":3000,\"bgColor\":\"060f16\",\"textColor4\":\"c59e5f\",\"textColor3\":\"c8ac7e\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/c8\\/53\\/02\\/c8530248-5071-a054-5500-20819b8dd656\\/196872662429.jpg\\/{w}x{h}bb.jpg\",\"width\":3000,\"textColor1\":\"f9d498\",\"textColor2\":\"f6c272\"},\"releaseDate\":\"2025-02-28\",\"audioVariants\":[],\"artistName\":\"LISA\"},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1780411784\",\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"catalogID\":{\"value\":\"1780411784\",\"kind\":\"adamID\"},\"isLibrary\":false,\"id\":\"1780411784\",\"preferredIdentifierKind\":\"catalogID\",\"type\":\"Album\"}}},{\"meta\":{\"musicKit_identifierSet\":{\"type\":\"Album\",\"preferredIdentifierKind\":\"catalogID\",\"id\":\"1635469682\",\"isLibrary\":false,\"catalogID\":{\"value\":\"1635469682\",\"kind\":\"adamID\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"]}},\"type\":\"albums\",\"attributes\":{\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/newjeans-1st-ep-new-jeans\\/1635469682\",\"isSingle\":false,\"editorialNotes\":{\"short\":\"The quintet’s low-key approach to K-pop pays off on their debut.\"},\"recordLabel\":\"ADOR\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"releaseDate\":\"2022-08-01\",\"trackCount\":4,\"artwork\":{\"textColor4\":\"424556\",\"bgColor\":\"fbfffc\",\"height\":1400,\"textColor1\":\"111431\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music112\\/v4\\/4e\\/64\\/34\\/4e64344b-3ac6-c503-2c41-257a15401416\\/192641873096_Cover.jpg\\/{w}x{h}bb.jpg\",\"width\":1400,\"textColor3\":\"3f435a\",\"textColor2\":\"13172c\"},\"contentRating\":\"clean\",\"audioVariants\":[],\"copyright\":\"℗ 2022 ADOR Co., Ltd.\",\"isCompilation\":false,\"isComplete\":true,\"isAppleDigitalMaster\":false,\"artistName\":\"NewJeans\",\"upc\":\"192641873096\",\"name\":\"NewJeans 1st EP \'New Jeans\'\",\"playParams\":{\"kind\":\"album\",\"id\":\"1635469682\",\"catalogId\":\"1635469682\"}},\"id\":\"1635469682\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1635469682\"},{\"id\":\"1644440668\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1644440668\",\"type\":\"albums\",\"attributes\":{\"isComplete\":true,\"isCompilation\":false,\"copyright\":\"℗ 2022 YG Entertainment, distributed through Interscope Records\",\"editorialNotes\":{\"tagline\":\"New Album in Spatial Audio\",\"short\":\"The K-pop sensations’ long-awaited second LP is here and is in Spatial.\",\"standard\":\"The Shirelles and The Supremes. Spice Girls and Destiny’s Child. Girls’ Generation and, now, BLACKPINK officially enter the pantheon of history-making, culture-defining girl groups. Since debuting in 2016 with YG Entertainment (the company also responsible for launching the careers of BIGBANG, 2NE1, and “Gangnam Style” hitmaker PSY), the K-pop quartet—rapper\\/singer JENNIE (Jennie Kim), rapper\\/dancer LISA (Lalisa Manobal), singers JISOO (Jisoo Kim) and ROSÉ (Chae-young Park)—have broken records and changed the face of modern pop. They have collaborated with Lady Gaga, Dua Lipa, and Selena Gomez while rocking Celine, Chanel, Dior, and Saint Laurent, major fashion houses for which they are ambassadors. They were the first K-pop girl group to perform at Coachella. They have become, without a doubt, one of the most popular K-pop groups across the globe—all with only a few singles and one full-length album to their name. Well, until now: <i>BORN PINK<\\/i>, the group’s highly anticipated sophomore release, heralds a new era for the band and a chance to stake out a real legacy.\\n \\nFrom the familiar raucous rap and hyperpop of single “Pink Venom” and the ROSÉ-led 2010s pop-rock “Ready for Love” to the haunting violins-meets-trap of “Shut Down” and the fully English-language piano ballad “The Happiest Girl,” <i>BORN PINK<\\/i> boasts a new eclecticism. The trick is in how the group succeeds without sacrificing any of the hallmarks of a classic, idiosyncratic BLACKPINK song: bombastic raps, nostalgic EDM drops, larger-than-life harmonies, multiple melodies stacked one after the other, and unbridled enthusiasm. When ROSÉ shouts, “I’m so rock ’n’ roll!” you believe her.\\n \\nPrior to the release of <i>BORN PINK<\\/i>, some fans (lovingly labeled BLINKs) were concerned about BLACKPINK’s material. With so few songs between them (and understanding that exclusivity breeds intrigue), what would their latest evolution look and sound like? How could they play into a pop landscape now devoid of BTS, the biggest K-pop group on the planet? Their pleasures are found in their indissoluble relationship with one another and how that manifests in each performance, harmony, and comeback for the group—and they have the potential to grow still. In a saturated pop and K-pop music market, BLACKPINK distinguishes themselves from the competition. They’re adaptable: unafraid of traversing new genres, styles, or fashions, somehow managing to make them all their own.\"},\"audioVariants\":[],\"artwork\":{\"textColor4\":\"535353\",\"width\":2000,\"height\":2000,\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music112\\/v4\\/94\\/b6\\/96\\/94b696c4-63be-8196-cae6-1f81be0a4cbe\\/22UM1IM01017.rgb.jpg\\/{w}x{h}bb.jpg\",\"textColor1\":\"0f0609\",\"textColor2\":\"2d2d2d\",\"bgColor\":\"e8e8e8\",\"textColor3\":\"3a3335\"},\"isAppleDigitalMaster\":true,\"upc\":\"00191222006854\",\"isSingle\":false,\"playParams\":{\"catalogId\":\"1644440668\",\"id\":\"1644440668\",\"kind\":\"album\"},\"contentRating\":\"explicit\",\"recordLabel\":\"YG Entertainment\\/Interscope Records\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/born-pink\\/1644440668\",\"artistName\":\"BLACKPINK\",\"trackCount\":8,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"name\":\"BORN PINK\",\"releaseDate\":\"2022-09-16\"},\"meta\":{\"musicKit_identifierSet\":{\"catalogID\":{\"value\":\"1644440668\",\"kind\":\"adamID\"},\"id\":\"1644440668\",\"isLibrary\":false,\"preferredIdentifierKind\":\"catalogID\",\"type\":\"Album\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"]}}},{\"attributes\":{\"isCompilation\":false,\"editorialNotes\":{\"tagline\":\"New Mini Album\",\"short\":\"Over six tracks, K-pop’s queens of hyperpop hooks continue their reign.\",\"standard\":\"Five months after the release of their first studio album <i>Armageddon<\\/i>, which included the megahit “Supernova,” aespa returned with <i>Whiplash<\\/i>. The six-track EP is the girl group’s fifth mini album since their explosive debut on the K-pop scene in 2020, and it continues their reign as the queens of hyperpop hooks. “One look, give ’em whiplash\\/Beat drop with a big flash,” cool girls Giselle, Karina, Ningning, and Winter express on the title track, an EDM-driven dance track about aespa’s ability to make everyone look twice. \\n\\nElsewhere on the album, the intentionally abrasive hip-hop dance song “Kill It” is simultaneously a declaration of K-pop dominance and a warning to any haters in the audience (“I’ma shine as I watch the bodies drop”), while the R&B track “Flights, Not Feelings” slows things down to confess a commitment to letting go of negative feelings (“I\'m not tryna hurt myself, tryna burn myself”).\\n\\n“Pink Hoodie” hopes to tap into some of that NCT U “Baggy Jeans” magic with a midtempo hip-hop track about feeling comfortable in one’s skin—and clothes (“Instead of a suffocating dress\\/Pink hoodie, ey-oh”), while the pop track “Flowers” hypnotizes with a lulling guitar riff and a dreamy description of intimacy (“Slowly look at me reflected in your eyes\\/A fantasy that spreads clearly\\/My only one\\/My dazzling flower\\/Keep calling me”). Album closer “Just Another Girl” layers the members’ vocals for a naughts-esque pop-rock song that matter-of-factly decimates a cheating lover (“Just remember\\/In the end, you are a loser\\/You\'ll regret it”). Altogether, <i>Whiplash<\\/i> is simultaneously aespa’s most cohesive project yet and a showcase of just how many different genres the members of this meticulously produced girl group can nail in one EP. As aespa explains on “Whiplash”: “I deliver, I can promise\\/I’m the coldest.”\\n\"},\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"audioVariants\":[],\"contentRating\":\"clean\",\"artwork\":{\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/d5\\/c1\\/f5\\/d5c1f505-f588-775f-df05-c672a8ec22e9\\/888735949562_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor3\":\"cbcbcb\",\"textColor1\":\"ffffff\",\"bgColor\":\"000000\",\"textColor2\":\"c5c5c5\",\"height\":1400,\"textColor4\":\"9d9d9d\",\"width\":1400},\"isComplete\":true,\"artistName\":\"aespa\",\"playParams\":{\"kind\":\"album\",\"id\":\"1772214980\",\"catalogId\":\"1772214980\"},\"recordLabel\":\"aespa\",\"isSingle\":false,\"upc\":\"888735949562\",\"releaseDate\":\"2024-10-21\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/whiplash-the-5th-mini-album-ep\\/1772214980\",\"name\":\"Whiplash - The 5th Mini Album - EP\",\"copyright\":\"℗ 2024 SM Entertainment\",\"trackCount\":6,\"isAppleDigitalMaster\":false},\"meta\":{\"musicKit_identifierSet\":{\"catalogID\":{\"value\":\"1772214980\",\"kind\":\"adamID\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"id\":\"1772214980\",\"isLibrary\":false,\"preferredIdentifierKind\":\"catalogID\",\"type\":\"Album\"}},\"type\":\"albums\",\"id\":\"1772214980\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1772214980\"},{\"meta\":{\"musicKit_identifierSet\":{\"type\":\"Album\",\"id\":\"1773694541\",\"preferredIdentifierKind\":\"catalogID\",\"isLibrary\":false,\"catalogID\":{\"value\":\"1773694541\",\"kind\":\"adamID\"},\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"]}},\"attributes\":{\"audioVariants\":[],\"copyright\":\"℗ 2024 SM Entertainment\",\"isComplete\":true,\"isSingle\":false,\"isCompilation\":false,\"playParams\":{\"catalogId\":\"1773694541\",\"id\":\"1773694541\",\"kind\":\"album\"},\"artistName\":\"aespa\",\"artwork\":{\"width\":1400,\"textColor2\":\"cfebb9\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/50\\/7e\\/e0\\/507ee09f-ccfd-1e3c-af90-ca5e92b1221b\\/00888735949869_Cover.jpg\\/{w}x{h}bb.jpg\",\"textColor1\":\"d4f7ba\",\"textColor4\":\"afca9b\",\"height\":1400,\"bgColor\":\"2f4623\",\"textColor3\":\"b3d49c\"},\"recordLabel\":\"SM Entertainment\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"trackCount\":10,\"name\":\"Armageddon - The 1st Album\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/armageddon-the-1st-album\\/1773694541\",\"upc\":\"00888735949869\",\"contentRating\":\"clean\",\"releaseDate\":\"2024-05-27\",\"isAppleDigitalMaster\":false},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1773694541\",\"type\":\"albums\",\"id\":\"1773694541\"},{\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1772223474\",\"meta\":{\"musicKit_identifierSet\":{\"catalogID\":{\"value\":\"1772223474\",\"kind\":\"adamID\"},\"type\":\"Album\",\"isLibrary\":false,\"preferredIdentifierKind\":\"catalogID\",\"id\":\"1772223474\",\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"]}},\"attributes\":{\"upc\":\"888735949791\",\"trackCount\":4,\"isComplete\":true,\"releaseDate\":\"2024-10-09\",\"name\":\"SYNK : PARALLEL LINE - Special Digital Single - EP\",\"audioVariants\":[],\"artistName\":\"aespa\",\"isAppleDigitalMaster\":false,\"isCompilation\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"contentRating\":\"clean\",\"isSingle\":false,\"playParams\":{\"id\":\"1772223474\",\"kind\":\"album\",\"catalogId\":\"1772223474\"},\"recordLabel\":\"SM Entertainment\",\"copyright\":\"℗ 2024 SM Entertainment\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/synk-parallel-line-special-digital-single-ep\\/1772223474\",\"artwork\":{\"height\":4000,\"textColor1\":\"ffffff\",\"textColor3\":\"ceced0\",\"textColor2\":\"b5b8c4\",\"width\":4000,\"bgColor\":\"0c0c17\",\"textColor4\":\"9396a2\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/fd\\/85\\/0e\\/fd850e67-f6e2-c4e9-6ea5-501ca5afccbd\\/aespa_DS_Synk-PARALLEL_LINE_DC.jpg\\/{w}x{h}bb.jpg\"}},\"id\":\"1772223474\"},{\"attributes\":{\"editorialNotes\":{\"tagline\":\"New Album\",\"short\":\"The BTS star’s second solo album is a more lighthearted and lyrical turn.\",\"standard\":\"Jimin returns with his sophomore solo album, <i>MUSE<\\/i>, released while the BTS vocalist and dancer was in mandatory military service. The seven-track check-in is more lighthearted and lyrical than Jimin’s debut. Where <i>FACE<\\/i> was stormy and cathartic, an intentional effort to accept and express the darker feelings evoked by the pandemic, superstardom, and life in general, <i>MUSE<\\/i> hews more closely to a specific, familiar theme: the search for a “good love, real love,” as Jimin calls it on “Rebirth (Intro),” and the inspiration it can bring.\\n\\nIn lead single “Who,” an energetic, Jon Bellion-produced pop track that lets Jimin’s emotive vocals loose, the artist is on the lookout for love: “We never met but she’s all I see at night\\/Never met but she’s always on my mind\\/Wanna give her the world\\/And so much more\\/Who is my heart waiting for?” “Who” is the only <i>MUSE<\\/i> track on which Jimin does not have a writing credit, though Ghstloop and Pdogg, two of Jimin’s frequent collaborators, do. Along with Evan, the four songwriters make up the Smeraldo Garden Marching Band, a fictional band named after a fictional flower from BTS lore. The album’s third track, a <i>Sgt. Pepper’s<\\/i>-inspired song featuring marching-band percussion and a rap from Korean artist Loco, takes its name from the Big Hit production team. \\n\\n“Be Mine,” with its Spanish guitar and unabashed sensuality (“Movin\', comin\', lovin\', yeah, yeah, yeah\\/I want you to be mine”), feels like a spiritual successor to Jimin’s 2020 BTS solo track “Filter,” while the lilting R&B tune “Slow Dance” featuring Sofia Carson offers “a warm melody\\/Relax your mind to that rhythm.” The album comes to a close with “Closer Than This,” a gift to fans released after the singer left for the military in December 2023: “\'Cause anytime you want me (I\'ll be)\\/Right here where you call me (I\'ll be)\\/I could never let you go.” In <i>MUSE<\\/i>, it’s all inspiration. Here, the search for love is not arduous, but whimsical, warm, and occasionally a bop—always a yearning worth singing about. \"},\"playParams\":{\"kind\":\"album\",\"catalogId\":\"1751773074\",\"id\":\"1751773074\"},\"artistName\":\"Jimin\",\"isCompilation\":false,\"name\":\"MUSE\",\"releaseDate\":\"2024-07-19\",\"audioVariants\":[],\"contentRating\":\"clean\",\"isComplete\":true,\"upc\":\"196922987588\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"artwork\":{\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/94\\/b5\\/84\\/94b58450-a0cd-ab97-2f30-0ed3608b5e24\\/196922987588_Cover.jpg\\/{w}x{h}bb.jpg\",\"bgColor\":\"75c5bc\",\"textColor1\":\"000000\",\"textColor4\":\"264441\",\"width\":1400,\"textColor3\":\"172726\",\"textColor2\":\"122423\",\"height\":1400},\"isSingle\":false,\"copyright\":\"℗ 2024 BIGHIT MUSIC\",\"recordLabel\":\"BIGHIT MUSIC\",\"trackCount\":7,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/muse\\/1751773074\",\"isAppleDigitalMaster\":false},\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"id\":\"1751773074\",\"catalogID\":{\"value\":\"1751773074\",\"kind\":\"adamID\"},\"preferredIdentifierKind\":\"catalogID\",\"isLibrary\":false,\"type\":\"Album\"}},\"id\":\"1751773074\",\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1751773074\"},{\"meta\":{\"musicKit_identifierSet\":{\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"preferredIdentifierKind\":\"catalogID\",\"type\":\"Album\",\"catalogID\":{\"value\":\"1773345352\",\"kind\":\"adamID\"},\"id\":\"1773345352\",\"isLibrary\":false}},\"type\":\"albums\",\"id\":\"1773345352\",\"attributes\":{\"isComplete\":true,\"playParams\":{\"catalogId\":\"1773345352\",\"id\":\"1773345352\",\"kind\":\"album\"},\"recordLabel\":\"S2 ENTERTAINMENT INC.\",\"trackCount\":7,\"upc\":\"8804775370199\",\"isSingle\":false,\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"isAppleDigitalMaster\":false,\"artistName\":\"KISS OF LIFE\",\"contentRating\":\"clean\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/lose-yourself\\/1773345352\",\"releaseDate\":\"2024-10-15\",\"artwork\":{\"height\":3000,\"width\":3000,\"bgColor\":\"000000\",\"textColor1\":\"ffffff\",\"textColor3\":\"cbcbcb\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music211\\/v4\\/dd\\/70\\/86\\/dd70863e-2571-25cd-d1eb-c44a5cdba57f\\/cover_KM0020274_1.jpg\\/{w}x{h}bb.jpg\",\"textColor4\":\"c6b3bd\",\"textColor2\":\"f7e0ed\"},\"audioVariants\":[],\"isCompilation\":false,\"name\":\"Lose Yourself\",\"copyright\":\"℗ 2024 S2 ENTERTAINMENT INC.,under license to Kakao Entertainment\"},\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1773345352\"},{\"id\":\"1772790085\",\"attributes\":{\"editorialNotes\":{\"tagline\":\"New Mini Album\",\"standard\":\"Girl-group rookies ILLIT returned in late 2024 with <i>I’LL LIKE YOU<\\/i>, a five-track follow-up to their debut EP <i>SUPER REAL ME<\\/i>. The latter included the fleet-footed pop magic of “Magnetic,” one of the breakout K-pop singles of 2024, and <i>I’LL LIKE YOU<\\/i> is constructed to continue the TikTok virality while also building the young group’s dreamy discography of bubbly young-love songs. \\n\\nIn a debut year where ILLIT’s debut single perhaps broke out more than the group itself, single “I’ll Like You” explicitly calls to mind the group’s name, a moniker that is constructed for fans to choose their own verb to place between “I’ll” and “it.” A slight track in both length and construction, “I’ll Like You” invites listeners into the teen girls’ pop-youth perspective on innocent attraction: “When I look at you\\/The world is in a moment, filter mode on.”\\n\\nIn “Cherish (My Love),” the theme of a willful young love continues, starting with the lulling declaration, “You know what?\\/Not even god can stop me\\/I\'ll like you,” before building to the stuttering delivery of the song’s catchy “ch, ch, ch, ch, cherish my love” chorus. Meanwhile, “IYKYK (If You Know You Know)” doubles down on new-gen K-pop’s habit of spelling out acronymic English-language internet slang—this time in service of further expressing the album’s central theme of “falling in like”: “This feels like sunshine\\/That sweet smile.”\\n\\nAcne has never sounded as romantic as it does on “Pimple,” a hazy pop song that uses the metaphor of a zit to express the sweet agony of developing an unexpected crush: “Little pimple\\/One day suddenly\\/Pimple sprouts\\/It stings, it’s you.” On the energetically onomatopoeic album closer “Tick-Tack,” ILLIT brings listeners into the sounds of a like: “Oh, oh my god\\/You\'re looking at me again\\/The coolest mode, click, click!”). The song and album have members Yunah, Minju, Moka, Wonhee, and Iroha signing off with an abrupt “Oh, nice to see ya,” just as dreamily casually as they came.\\n\",\"short\":\"The K-pop girl group follows up their debut with more young-love pop songs.\"},\"artistName\":\"ILLIT\",\"name\":\"I\'LL LIKE YOU - EP\",\"playParams\":{\"kind\":\"album\",\"id\":\"1772790085\",\"catalogId\":\"1772790085\"},\"releaseDate\":\"2024-10-21\",\"contentRating\":\"clean\",\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"audioVariants\":[],\"isCompilation\":false,\"copyright\":\"℗ 2024 BELIFT LAB\",\"isSingle\":false,\"recordLabel\":\"BELIFT LAB\",\"isAppleDigitalMaster\":false,\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/ill-like-you-ep\\/1772790085\",\"isComplete\":true,\"upc\":\"198704136962\",\"artwork\":{\"textColor2\":\"20271f\",\"width\":1400,\"textColor3\":\"3b3f35\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music221\\/v4\\/e9\\/20\\/73\\/e9207332-1b22-18d0-5d1b-daaf370a4317\\/198704136962_Cover.jpg\\/{w}x{h}bb.jpg\",\"bgColor\":\"f3f1e7\",\"height\":1400,\"textColor4\":\"4a4f47\",\"textColor1\":\"0d1309\"},\"trackCount\":5},\"meta\":{\"musicKit_identifierSet\":{\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1772790085\"},\"isLibrary\":false,\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"type\":\"Album\",\"preferredIdentifierKind\":\"catalogID\",\"id\":\"1772790085\"}},\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1772790085\"},{\"meta\":{\"musicKit_identifierSet\":{\"id\":\"1533894050\",\"catalogID\":{\"kind\":\"adamID\",\"value\":\"1533894050\"},\"preferredIdentifierKind\":\"catalogID\",\"isLibrary\":false,\"dataSources\":[\"catalog\",\"localLibrary\",\"legacyModel\"],\"type\":\"Album\"}},\"id\":\"1533894050\",\"type\":\"albums\",\"href\":\"\\/v1\\/catalog\\/ca\\/albums\\/1533894050\",\"attributes\":{\"editorialNotes\":{\"standard\":\"Who could’ve seen them coming—a K-pop girl group reaching total global ubiquity and instantaneous virality without a full-length album to their name? And yet BLACKPINK has been announcing their plans for world domination since their first single, 2016’s “Boombayah,” when rapper Jennie Kim opened the song with the quartet’s now-illustrious slogan, “BLACKPINK in your area!” It was not a request or a demand—it was a declaration of arrival.<br \\/>\\nJennie, Lisa (Lalisa Manoban), Rosé (Chae-young Park), and Jisoo (Ji-soo Kim) have been meticulously preparing for this moment since meeting as trainees in 2011: the release of their long-awaited debut LP, appropriately titled <i>THE ALBUM<\\/i>. (If most new artists go the eponymous route for their definitive work, BLACKPINK has taken it a step further, claiming the format as a whole.) From their A-list collaborations (2018’s “Kiss and Make Up” with Dua Lipa, 2020’s “Sour Candy” with Lady Gaga) to their world-record-breaking hits “DDU-DU DDU-DU” and “Kill This Love,” BLACKPINK has worked hard with their longtime producer, YG Entertainment’s Teddy Park, to establish their sonic signatures: big, brassy production; sprightly raps; stacked multilingual harmonies; and genre-ambivalent transitions. On <i>THE ALBUM<\\/i>, they’ve perfected the equation, offering saccharine girl-crush confections (“Ice Cream” with Selena Gomez, cowritten by Ariana Grande and Victoria Monét—their “pink” side) and fierce, no-nonsense empowerment messaging (“Pretty Savage”—their “black”) in equal measure.<br \\/>\\nAcross eight tracks, <i>THE ALBUM<\\/i> is expansive. “Bet You Wanna,” cowritten by OneRepublic’s Ryan Tedder and BTS songwriter Melanie Joy Fontana, is BLACKPINK’s first collaboration with a rapper, the pre-eminent Cardi B. “Lovesick Girls” echoes big, loud, and feminist Icona Pop-esque dance music, and “Love to Hate Me” is Y2K-era R&B pop worship. Even <i>THE ALBUM<\\/i>’s closer “You Never Know” traverses unexpected territory: an anti-judgment anthem, a ballad for their beloved Blinks. <i>How you like that?<\\/i>\",\"short\":\"The debut LP perfects the formula: girl-crush confections, fierce anthems.\"},\"genreNames\":[\"K-Pop\",\"Music\",\"Pop\"],\"recordLabel\":\"YG Entertainment\\/Interscope Records\",\"isCompilation\":false,\"artwork\":{\"bgColor\":\"0e0508\",\"height\":4000,\"textColor3\":\"ce93a2\",\"textColor1\":\"feb6c8\",\"url\":\"https:\\/\\/is1-ssl.mzstatic.com\\/image\\/thumb\\/Music125\\/v4\\/c3\\/64\\/46\\/c364465f-6271-8aae-93a8-b9979d2befe5\\/20UMGIM82075.rgb.jpg\\/{w}x{h}bb.jpg\",\"textColor2\":\"f795ac\",\"width\":4000,\"textColor4\":\"c9788b\"},\"contentRating\":\"clean\",\"isSingle\":false,\"playParams\":{\"catalogId\":\"1533894050\",\"id\":\"1533894050\",\"kind\":\"album\"},\"isAppleDigitalMaster\":true,\"releaseDate\":\"2020-10-02\",\"audioVariants\":[],\"isComplete\":true,\"copyright\":\"℗ 2020 YG Entertainment, distributed through Interscope Records\",\"name\":\"THE ALBUM\",\"upc\":\"00191222005192\",\"url\":\"https:\\/\\/music.apple.com\\/ca\\/album\\/the-album\\/1533894050\",\"trackCount\":8,\"artistName\":\"BLACKPINK\"}}],\"orderId\":\"most-played:albums\"}],\"playlists\":[]}}".data(using: .utf8)


